import { Link } from "react-router-dom";

const Opinioes = () => {
    return (
        <>

            <Link to='../paginas/'><img className="imgLogo" src={require(`../imagens/logo.png`)} height={707} width={707} alt='' /></Link>

            <img className="imgLogo" src={require(`../imagens/titulos/opinioes.png`)} height={600} width={600} alt='' />


        </>
    );
}

export default Opinioes;
